DELIMITER $$
--
-- Процедуры
--
CREATE DEFINER=`root`@`%` PROCEDURE `calculate_product_profit` (IN `p_product_id` INT, IN `p_cost_price` DECIMAL(10,2), IN `p_other_expenses` DECIMAL(10,2), IN `p_selling_price` DECIMAL(10,2), OUT `p_net_profit` DECIMAL(10,2))   BEGIN
  DECLARE bank_fee_percent DECIMAL(4,3);
  DECLARE tax_rate DECIMAL(4,2) DEFAULT 0.06; -- 6%
  
  -- Получаем процент банковского сбора из fixed_costs
  SELECT bank_fee INTO bank_fee_percent FROM fixed_costs WHERE id = 1;
  
  -- Расчёт чистой прибыли на единицу товара:
  -- Чистая прибыль = Цена продажи - себестоимость - прочие расходы - налог с продажи - банковский сбор
  SET p_net_profit = p_selling_price - p_cost_price - p_other_expenses - (p_selling_price * tax_rate) - (p_selling_price * bank_fee_percent);
END$$

DELIMITER ;

